{'id': '16817482', 'text': "I could write something short and simple, but that isn't possible with Dilvin.  I was a clown around her friends, telling jokes and talking nonsense, but when I hung out with her, we were more like authors writing the novels of our respective countries.

In three days of eating and drinking in Timisoara, there was never a moment of silence.  She covered the long history of Mesopotamia, Persia, all of the thousands of Ottoman sultans, Kemal Atatuk and her own involvement in the recent protests of Istanbul.  I went backwards, starting with the riots that just broke out in my own American city of St. Louis, going back through our Civil War and ending with bedtime stories from the indigenous people who lived in my area before Europeans came.

Yeah, we talked a lot.  And we will talk a lot more.  I blame it on all that Turkish coffee and Serbian wine.", 'createdDate': '2014-12-03T18:29:38Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '3415524'}, 'from': {'id': '1459106', 'publicName': 'Raleigh McMullen', 'publicAddress': {'id': '4164228', 'description': 'Belgrade, Central Serbia, Serbia'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1459106/c2cccf52-c44e-43f2-b1ec-896d440fcedf', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '14063823', 'text': 'Why, why, why must you give me a million reasons to stay forever in Banska Stiavnica? Margaret keeps you captivated with her great cooking and entertaining travel stories. Bartek, often quieter, speaks through the incredible work that he has put into this elegant house (with those ceramic heaters) that I lived in for 3 days! 

They took me into town every night where I got to jam with the local musicians, and tried very hard to make me stay longer for their big "slow food" dinner party! Even the chopping "work" was great, since I like playing with chainsaws anyway.

As Bartek says, "U vidime..."', 'createdDate': '2013-10-16T08:54:27Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '443387'}, 'from': {'id': '1459106', 'publicName': 'Raleigh McMullen', 'publicAddress': {'id': '4164228', 'description': 'Belgrade, Central Serbia, Serbia'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1459106/c2cccf52-c44e-43f2-b1ec-896d440fcedf', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

