{'id': '14123592', 'text': 'Many people say Transnistria is dangerous. Yes, it is true because people here will make you eat too much food, drink too much wine and show you too much hospitality!! Olga and her friends made sure I was never hungry and (almost) never sober...

Olga and her son spent their free time showing me Tiraspol museums, parks, cafes, "Sheriffs" and further locations like Bendery fortress and the 'domacno' wine cellars of a small town called Grigriopol. I even got to improve my Russian language by having conversations with their talkative parrot, Gosha.

It was pleasure to play concerts for them in Tiraspol, share my perspective as a foreigner and help Nikita practice his English. I predict he will be Transnistria's most successful translator very soon. Thank you very much for your incredible hospitality, help and patience. It certainly would not have been the same without you!', 'createdDate': '2013-10-27T21:31:50Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '1003097475'}, 'from': {'id': '1459106', 'publicName': 'Raleigh McMullen', 'publicAddress': {'id': '4164228', 'description': 'Belgrade, Central Serbia, Serbia'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1459106/c2cccf52-c44e-43f2-b1ec-896d440fcedf', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '14073444', 'text': 'We are on opposite sides of the guitar coin, but have a mutual respect for music. He invited me to a jazz jam session with people who were waaaay more talented than me, and I showed him that on the streets, entertainment can be more important (ummm...profitable?) than talent.

We also learned special Romanian Agricultural Guy behavior like: marking your territory, showing your value, enjoying Manele music and speaking properly with girls who suffer from the "Consuela Effect."

No, no, no...? Wrong. If you are in Cluj, say "Yes, yes, yes" to 'Beer-Oh.'', 'createdDate': '2013-10-17T20:17:55Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '2663799'}, 'from': {'id': '1459106', 'publicName': 'Raleigh McMullen', 'publicAddress': {'id': '4164228', 'description': 'Belgrade, Central Serbia, Serbia'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1459106/c2cccf52-c44e-43f2-b1ec-896d440fcedf', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '13856958', 'text': 'I know Michal has plenty of energy to show you the best parts of Plzen! However, due to an unfortunate (but funny) incident with a bicycle and a police car, he had to spend most of the time "relaxing" indoors. Skoda... 

Seriously, it's great to spend time with another serious worker: he has his cool projects, and I have my music and writing. When we weren't occupied, we exchanged information on the variety of Czech beers, smoked nargila with friends and played unique board games while trying to make the Magic Gyroscope work.

My advice: If you play the Duck Game, be sure not to be the purple duck! Pozor!', 'createdDate': '2013-09-10T11:20:20Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '5513502'}, 'from': {'id': '1459106', 'publicName': 'Raleigh McMullen', 'publicAddress': {'id': '4164228', 'description': 'Belgrade, Central Serbia, Serbia'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1459106/c2cccf52-c44e-43f2-b1ec-896d440fcedf', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

